import Html5 from 'assets/icons8-html-5.png';
import Css3 from 'assets/icons8-css3.png';
import Javascript from 'assets/icons8-javascript.svg';
import Bootstrap from 'assets/icons8-bootstrap.png';
import Sass from 'assets/icons8-sass.png';
import Jquery from 'assets/icons8-jquery.png';
import Reactjs from 'assets/icons8-react.png';
import cplus from 'assets/icons8-c++.svg';
import Github from 'assets/icons8-github.svg';

//dont forget features has a text attribute

export default {
  subTitle: 'Skills',
  title: 'These are some weapons in my arsenal',
  features: [
    {
      id: 1,
      imgSrc: Html5,
      altText: 'html5',
      title: 'HTML5',
    },
    {
      id: 2,
      imgSrc: Css3,
      altText: 'css3',
      title: 'CSS3',
    },
  ],
};
